contracts/ContractVerifier.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract ContractVerifier {
    struct ContractVersion {
        bytes32 fileHash;
        address uploader;
        uint256 timestamp;
    }

    mapping(uint256 => ContractVersion[]) public contractHistory;

    address public owner;
    mapping(address => bool) public uploaders;

    event ContractUploaded(uint256 indexed contractId, bytes32 fileHash, address indexed uploader);
    event UploaderAdded(address indexed uploader);
    event UploaderRemoved(address indexed uploader);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can operate");
        _;
    }

    modifier onlyUploader() {
        require(uploaders[msg.sender], "Not authorized to upload");
        _;
    }

    constructor() {
        owner = msg.sender;
        uploaders[msg.sender] = true; // 默认部署者有上传权限
    }

    function addUploader(address uploader) external onlyOwner {
        uploaders[uploader] = true;
        emit UploaderAdded(uploader);
    }

    function removeUploader(address uploader) external onlyOwner {
        uploaders[uploader] = false;
        emit UploaderRemoved(uploader);
    }

    function uploadContract(uint256 contractId, bytes32 fileHash) external onlyUploader {
        ContractVersion memory version = ContractVersion({
            fileHash: fileHash,
            uploader: msg.sender,
            timestamp: block.timestamp
        });

        contractHistory[contractId].push(version);
        emit ContractUploaded(contractId, fileHash, msg.sender);
    }

    function getLatestHash(uint256 contractId) external view returns (bytes32) {
        uint len = contractHistory[contractId].length;
        require(len > 0, "No contract uploaded");
        return contractHistory[contractId][len - 1].fileHash;
    }

    function getHistoryCount(uint256 contractId) external view returns (uint256) {
        return contractHistory[contractId].length;
    }

    function getHistory(uint256 contractId, uint256 version) external view returns (ContractVersion memory) {
        return contractHistory[contractId][version];
    }
}

contracts/DTrustAccessControl.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract DTrustAccessControl is AccessControl {
    // 系统角色
    bytes32 public constant ADMIN_ROLE     = keccak256("ADMIN_ROLE");
    bytes32 public constant UPLOADER_ROLE  = keccak256("UPLOADER_ROLE");
    bytes32 public constant AUDITOR_ROLE   = keccak256("AUDITOR_ROLE");
    bytes32 public constant BUSINESS_ROLE  = keccak256("BUSINESS_ROLE");

    // 用户所属部门映射
    mapping(address => string) public userDepartment;

    // 用户合约权限映射：用户地址 => 合约ID => 是否授权
    mapping(address => mapping(uint256 => bool)) public userContractAccess;

    constructor(address admin) {
        _grantRole(DEFAULT_ADMIN_ROLE, admin);
        _grantRole(ADMIN_ROLE, admin);
    }

    // === 管理员功能 ===

    // 设置用户所属部门（如 "legal", "business", "audit"）
    function setUserDepartment(address user, string calldata department) external onlyRole(ADMIN_ROLE) {
        userDepartment[user] = department;
    }

    // 授权某用户访问某个合同ID
    function grantContractAccess(address user, uint256 contractId) external onlyRole(ADMIN_ROLE) {
        userContractAccess[user][contractId] = true;
    }

    // 撤销访问权限
    function revokeContractAccess(address user, uint256 contractId) external onlyRole(ADMIN_ROLE) {
        userContractAccess[user][contractId] = false;
    }

    // 设置角色
    function grantUserRole(address user, bytes32 role) external onlyRole(ADMIN_ROLE) {
        grantRole(role, user);
    }

    function revokeUserRole(address user, bytes32 role) external onlyRole(ADMIN_ROLE) {
        revokeRole(role, user);
    }

    // === 外部可读函数 ===

    function hasAccessToContract(address user, uint256 contractId) public view returns (bool) {
        return userContractAccess[user][contractId];
    }

    function getUserDepartment(address user) public view returns (string memory) {
        return userDepartment[user];
    }

    function isUploader(address user) public view returns (bool) {
        return hasRole(UPLOADER_ROLE, user);
    }

    function isAuditor(address user) public view returns (bool) {
        return hasRole(AUDITOR_ROLE, user);
    }

    function isBusinessUser(address user) public view returns (bool) {
        return hasRole(BUSINESS_ROLE, user);
    }
}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

